INSERT INTO `content` VALUES (1,'<p>虎鲸，是鲸偶蹄目海豚科虎鲸属 [19] 哺乳动物 [20] 。成体体重6600千克，平均体长6-9米；头部略圆，具有不明显的喙或无喙；身体黑、白两色；眼的后上方具椭圆形的白色眼斑；上颌和下颌每侧都有10-12枚圆锥形的齿；雄性体长大于雌性，体重约为雌性成体的一倍 [19] 。虎鲸头大，黑白色相间，视若虎，故名 [21] 。虎鲸分布于中国辽宁、山东、浙江、台湾附近海域，在全球各大洋也有分布，高纬度地区和近岸海域常见。 [19] 虎鲸是大洋性种类，没有固定栖息场所，主要追逐其所嗜食的鱼类或其他海兽移动 [22] ，通常聚集成5-20头的群，也有达到100头或更多的群。 [19] 虎鲸除食大型鱼类外，常成群追食海豹、海狗、海象、海豚等海兽，甚至袭击大型的须鲸类 [23] 。雌性虎鲸每5年产1仔，终生可产5仔。雄性寿命50-60年，雌性寿命80-90年。 [19] 虎鲸是一种高度社会化的动物，会组成家族，而且是动物世界里最稳定的家族，有较为复杂的社会行为、捕猎技巧和声音交流等。 [24] 海洋中，虎鲸是“海上杀手”，小到鱼类、乌贼、海龟，大到海狮、海豹甚至须鲸和抹香鲸，都难逃虎鲸的捕杀，因此，虎鲸也有着“杀手鲸”的称号。 [25] 海洋环境的污染以及大量捕捉虎鲸活体用于水族贸易，虎鲸的生存受到严重威胁 [26] ，现已被列为中国二级保护野生动物。 [19]12323131</p>'),(2,'<p>虎鲸是虎鲸属中仅有公认的物种，也是林奈于1758年在《自然系统》中最初描述的许多动物物种之一。因其头大，黑白色相间，视若虎，故名。康拉德·格斯纳（Konrad Gessner）在对格赖夫斯瓦尔德湾（Bay of Greifswald）的一头搁浅而死的动物进行了检查后，在他于1558年撰写的《鱼和水生动物的世界 》（Piscium&aquatilium animantium natura）（较大的历史动物区系）中首次对虎鲸进行了科学描述，引起了当地极大的关注。<br>[3-4] &nbsp;<br>[21] <br>虎鲸是大约一百万年前首次出现的海洋海豚科中的35个物种之一。此后不久，虎鲸血统就有分支。理查德·勒杜克（Richard LeDuc）对细胞色素b基因序列的研究表明，尽管它与伪虎鲸、小虎鲸和领航鲸在形态上相似，但它最接近的近亲是伊豚属的澳大利亚短平鼻海豚。然而，2018年的一项研究将虎鲸作为海豚亚科的姊妹类群，其中包括斑纹海豚属和矮海豚属。<br>[5-6] &nbsp;尽管“逆戟鲸”一词的使用越来越多，但说英语的科学家最常使用的还是传统名称“虎鲸”。虎鲸属“Orcinus”学名的意思是“死者之国”。古罗马人最初将逆戟鲸（pl.orcae）用于这些动物，可能借用了古希腊语ὄρυξ（óryx），该词除其他外还指鲸种。自1960年代以来，“逆戟鲸”一直在稳步增长。一些人更喜欢“逆戟鲸”一词，因为它避免了“杀手”（killer）的消极含义，并且因为作为海豚科的一部分，该物种与其他海洋海豚的关系比与其他鲸鱼的关系更为密切。<br>[7] <br>它们有时被称为“黑鲸”（blackfish），也用于其他鲸鱼种类。“灰海豚” （Grampus）是该物种的前称，但已经很少使用。 “ grampus”的含义不应与灰海豚属（Grampus）混淆，后者的唯一成员称灰海豚。<br>[8] <br>即使有越来越多的证据表明该分类单位实际上是一个单一物种，实际上它是具有形态、遗传、生态和行为差异的多种形式的复合体，即使不是物种名称，也应具有亚种的价值。在撰写本文时（2017年6月），海洋哺乳动物学会分类学委员会（The Marine Mammalogy\'s Taxonomy Committee）被认为是海洋哺乳动物分类法的权威，认可了单一的虎鲸物种”Orcinus orca“（Linnaeus，1758年）和北太平洋东部的两个未命名的亚种，即东太平洋居留鲸（O. o.un-named subsp.）。 东太平洋过客鲸（O. o.un-named subsp.）也被称为“大虎鲸”（Bigg’s killer whal）。然而，海洋哺乳动物学会注意到：“北太平洋、北大西洋和南极南部海洋中的其他形式的虎鲸可能需要确认为单独的亚种甚至物种，但分类法尚未得到充分阐明或同意。根据2003年的《加拿大濒危物种法》，北太平洋东部原产地亚种中的一个种群“南方种群”（the “southern resident” population ）被列为美国2005年的《濒危物种法》中的“濒危物种”。<br>[2] <br>截止到2017年已定义和认可的分类单元是虎鲸（《海洋哺乳动物学会》2017年），不符合IUCN红色名录中受威胁地位的任何标准。虎鲸在数量上非常丰富（至少成千上万的成熟个体）并且分布非常广泛。专家们一致认为，分类单元可能包括一个以上的亚种，并且可能包括多个物种。已知一些小区域人口已经大幅下降，如果单独评估，将很容易获得受威胁的地位（例如，ENP的物种，与直布罗陀海峡有关的依赖蓝鳍金枪鱼的虎鲸数量），但没有足够的证据支持全球虎鲸物种丰富度的下降，使其符合标准A。但是，先前的物种评估（Taylor等人，2013年）中的声明仍然成立：“由猎物资源枯竭和污染物的影响驱动的潜在下降的组合，人们认为，对于某些可能最终被指定为虎鲸物种的“群体”，不能排除在三代中全球减少30%的可能性。”<br>[2] <br>尽管人们仍在继续努力以更好地了解虎鲸属的分类学，但是分类学问题尚未完全解决。由于在北太平洋东部，南极和其他地方可能出现同生，非交配生态型，这尤其成问题。由于分类学的不确定性，该分类单元先前被IUCN列为“数据不足”，并且应该继续列出，直到描述了适当的分类单元并可以对其进行红色名录列表评估。<br>[2] 123<br>（注：ENP 北太平洋东部。“eastern North Pacific”）<br></p>'),(3,'<p>1231231313</p>'),(4,'<p>111123</p>'),(5,'<p>111</p>'),(6,'<p>测试16测试16</p>'),(7,'<p>测试16</p>'),(21,'<p>测试1212</p>'),(22,'<p>vue入门</p>'),(23,'<p>1、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A4%A7%E5%8F%B6%E6%B5%B7%E8%97%BB/5715519?fromModule=lemma_inlink\">大叶海藻</a>：皱缩卷曲，黑褐色，有的被白霜，长30～60cm。主干呈圆柱状，具圆锥形突起，主枝自主干两侧生出，侧枝自主枝叶腋生出，具短小的刺状突起。初生叶披针形或倒卵形，长5～7cm，宽约1cm，全缘或具粗锯齿；次生叶条形或披针形，叶腋间有着生条状叶的小枝。气囊黑褐色，球形或卵圆形，有的有柄，顶端钝圆，有的具细短尖。质脆，潮润时柔软；水浸后膨胀，肉质，粘滑。气腥，味微咸。</p><p>2、小叶海藻：较小，长15～40cm。分枝互生，无刺状突起。叶条形或细匙形，先端稍膨大，中空。气囊腋生，纺锤形或球形，囊柄较长。质较硬。<sup>&nbsp;[1]</sup><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p>'),(24,'<p>测试18</p>'),(25,'<p>测试测试</p>'),(26,'<p>css基础</p>');
INSERT INTO `content` VALUES (27,'<p>主要分布于西太平洋热带沿海，澳大利亚和印度亦产。中国境内无分布。<sup>&nbsp;[2]</sup><a>&nbsp;</a></p><p>于缪汝槐(1981)曾报道中国海南岛发现澳洲波喜荡(Posidonia australis)，文中所提标本(标本号121490，于1960年7月26日采集于海南岛，存放于中山大学植物标本馆)，经澳大利亚的GaryKendrick教授重新鉴定后确认为海菖蒲(Enhalusacoroides)，并非澳洲波喜荡。因后者仅分布于澳大利亚南部海域，生长区域比较狭窄，属典型的温带海草(Short et al., 2007)，且在近年来的调查中亦未在我国发现该种，因此将澳洲波喜荡从我国海草原名单(范航清等, 2009)中剔除。此外, Flora of China(Flora of China Editorial Committee, 2010)里记录的澳洲波喜荡生境为“浅海海底低潮线上”，亦与其实际生境不符，澳洲波喜荡生长于低潮线下至水深12 m，水质较清时可至22 m水深处(Short et al.,2012)。</p><p><br/></p><p>&nbsp; &nbsp;&nbsp;<img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><br/>');
INSERT INTO `content` VALUES (28,'<p>虎鲸，是鲸偶蹄目海豚科虎鲸属哺乳动物。也是海豚科中体型最大的一种。成年雄性平均长度为8米，最大记录是9.75米，雌性体重3.8吨，雄性体重5.5吨。雌性平均长度为7米，最大长度为8.5米。身体大小、鳍肢大小和背鳍高度有明显的性二型。雌性的平均体重和体重略小于雄性。雌性最大体长达7.70 米，雄性体长达9米。1头体长6.70米的雌性重3.8吨，而1头体长6.75米的雄性重5.5吨。雄性成体的背鳍直立，高可达1.0-1.8米，雌性的背鳍明显地镰刀形，高不及0.7米。该鳍弯曲到右侧或左侧。\n[9-10]&nbsp;&nbsp;\n[17]&nbsp;\n\n[19-20]&nbsp;&nbsp;\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n虎鲸\n\n\n虎鲸成体头骨的髁基长可达1000毫米。在眶前凹前方过两前颌骨的宽小于吻突宽。两翼骨远隔开。颞窝大。下颌骨相对较短。具有不明显的喙。椭圆形的鳍肢位于体全长的前1/4处。雄性的鳍肢长可达体全长的20%，雌性的达11%-13%。尾叶宽可超过体全长的1/5。\n[9]&nbsp;\n虎鲸体形呈纺锤形，表面光滑，皮肤下面有一层很厚的脂肪用来保存身体的热量。身体上的颜色黑白分明，背部为漆黑色，在鳍的后面有一个马鞍形的灰白色斑，两眼的后面各有一块梭形的白斑，腹面大部分为雪白的颜色。下颌及从下颌前端到尿殖区的体腹面白色。有1个白色的叶状斑从尿殖区向上伸到背鳍后的体侧。尾叶的腹面白色或浅灰色，可能具黑色边缘。在每侧眼的后上方具椭圆形的白色眼斑。鞍斑在年幼时不明显，性成熟后更显著。<img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><p>&nbsp;[19]&nbsp;\n虎鲸头部略圆，具有不明显的喙或无喙；没有突出的吻部，鼻孔在头顶的右侧，有开关自如的活瓣，当浮到水面上时，就打开活瓣呼吸，喷出一片泡沫状的气雾，遇到海面上的冷空气就变成了一根水柱。前肢变为一对鳍，很发达，后肢退化消失。高耸于背部中央的强大的三角形背鳍，十分显眼，既是进攻的武器，又可以起到舵的作用。嘴很大，上颌和下颌每侧都有10-12枚圆锥形的齿，其横切面呈椭圆形，齿尖向内和向后。在一些较老的个体，齿常被磨蚀或溃烂损坏。椎式：C7，T11-13，L10-12，Ca20-24=50-54。\n[18-19]</p>'),(29,'<p>&nbsp; &nbsp; &nbsp; 东海主要出现于水深大于200m的陆架外，其垂直分布在50m上层；南海有时出现在l000m水深，但主要栖息在100m上层。一年四季出现于南海北部陆架内外区以及中沙、西沙群岛周围海区，数量较多，为西沙群岛海域管水母类优势种之一。属大洋广布科。本种在百慕大海域垂直分布局限于50m上层；在加那利群岛水深40m或50m拖网采到的样品，有半以上是这种水母<br/></p><p><br/></p><p><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><br/>'),(30,'<p>测试1223111</p>'),(32,'<p>李林翰吃我丝袜</p>');
INSERT INTO `content` VALUES (70,'<article><p>虎鲸，是鲸偶蹄目海豚科虎鲸属\n[19]&nbsp;\n哺乳动物\n[20]&nbsp;\n。成体体重6600千克，平均体长6-9米；头部略圆，具有不明显的喙或无喙；身体黑、白两色；眼的后上方具椭圆形的白色眼斑；上颌和下颌每侧都有10-12枚圆锥形的齿；雄性体长大于雌性，体重约为雌性成体的一倍\n[19]&nbsp;\n。虎鲸头大，黑白色相间，视若虎，故名\n[21]&nbsp;\n。虎鲸分布于中国辽宁、山东、浙江、台湾附近海域，在全球各大洋也有分布，高纬度地区和近岸海域常见。\n[19]&nbsp;\n虎鲸是大洋性种类，没有固定栖息场所，主要追逐其所嗜食的鱼类或其他海兽移动\n[22]&nbsp;\n，通常聚集成5-20头的群，也有达到100头或更多的群。\n[19]&nbsp;\n虎鲸除食大型鱼类外，常成群追食海豹、海狗、海象、海豚等海兽，甚至袭击大型的须鲸类\n[23]&nbsp;\n。雌性虎鲸每5年产1仔，终生可产5仔。雄性寿命50-60年，雌性寿命80-90年。\n[19]&nbsp;\n虎鲸是一种高度社会化的动物，会组成家族，而且是动物世界里最稳定的家族，有较为复杂的社会行为、捕猎技巧和声音交流等。\n[24]&nbsp;\n海洋中，虎鲸是“海上杀手”，小到鱼类、乌贼、海龟，大到海狮、海豹甚至须鲸和抹香鲸，都难逃虎鲸的捕杀，因此，虎鲸也有着“杀手鲸”的称号。\n[25]&nbsp;\n海洋环境的污染以及大量捕捉虎鲸活体用于水族贸易，虎鲸的生存受到严重威胁\n[26]&nbsp;\n，现已被列为中国二级保护野生动物。\n[19]<img src=\"https://bkimg.cdn.bcebos.com/pic/0824ab18972bd40710d94ba874899e510fb3094c?x-bce-process=image/resize,m_lfit,w_536,limit_1/format,f_auto\" alt=\"虎鲸\" style=\"font-size: 14px;\"><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"></p><br></article>');
INSERT INTO `content` VALUES (71,'<p>为大家大家</p><p>安吉万达加我</p>'),(1031933952,'<p>啊达瓦大大娃娃</p>'),(1031933953,'<p> &nbsp; &nbsp; &nbsp;<span style=\"color: rgb(231, 95, 51);\">东海主要出现于水深大于200m的陆架外</span>，其垂直分布在50m上层；南海有时出现在l000m水深，但主要栖息在100m上层。一年四季出现于南海北部陆架内外区以及中沙、西沙群岛周围海区，数量较多，为西沙群岛海域管水母类优势种之一。属大洋广布科。本种在百慕大海域垂直分布局限于50m上层；在加那利群岛水深40m或50m拖网采到的样品，有半以上是这种水母<br></p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" data-href=\"\" style=\"\"/></p><p><br></p>'),(1031933954,'<p> &nbsp; &nbsp; <span style=\"font-size: 22px;\"> </span><span style=\"font-size: 22px; font-family: 微软雅黑;\">东海主要出现于水深大于200m的陆架外，</span>其垂直分布在50m上层；南海有时出现在l000m水深，但主要栖息在100m上层。一年四季出现于南海北部陆架内外区以及中沙、西沙群岛周围海区，数量较多，为西沙群岛海域管水母类优势种之一。属大洋广布科。本种在百慕大海域垂直分布局限于50m上层；在加那利群岛水深40m或50m拖网采到的样品，有半以上是这种水母<br></p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" data-href=\"\" style=\"\"/></p><p><br></p>'),(1031933955,'<p> &nbsp; &nbsp; &nbsp;东海主要出现于水深大于200m的陆架外，其垂直分布在50m上层；南海有时出现在l000m水深，但主要栖息在100m上层。一年四季出现于南海北部陆架内外区以及中沙、西沙群岛周围海区，数量较多，为西沙群岛海域管水母类优势种之一。属大洋广布科。本种在百慕大海域垂直分布局限于50m上层；在加那利群岛水深40m或50m拖网采到的样品，有半以上是这种水母。。。<br></p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" data-href=\"\" style=\"\"/></p><p><br></p>'),(1031933956,'<p>121313</p>'),(1031933957,'<p>虎鲸，是鲸偶蹄目海豚科虎鲸属 [19] 哺乳动物 [20] 。成体体重6600千克，平均体长6-9米；头部略圆，具有不明显的喙或无喙；身体黑、白两色；眼的后上方具椭圆形的白色眼斑；上颌和下颌每侧都有10-12枚圆锥形的齿；雄性体长大于雌性，体重约为雌性成体的一倍 [19] 。虎鲸头大，黑白色相间，视若虎，故名 [21] 。虎鲸分布于中国辽宁、山东、浙江、台湾附近海域，在全球各大洋也有分布，高纬度地区和近岸海域常见。 [19] 虎鲸是大洋性种类，没有固定栖息场所，主要追逐其所嗜食的鱼类或其他海兽移动 [22] ，通常聚集成5-20头的群，也有达到100头或更多的群。 [19] 虎鲸除食大型鱼类外，常成群追食海豹、海狗、海象、海豚等海兽，甚至袭击大型的须鲸类 [23] 。雌性虎鲸每5年产1仔，终生可产5仔。雄性寿命50-60年，雌性寿命80-90年。 [19] 虎鲸是一种高度社会化的动物，会组成家族，而且是动物世界里最稳定的家族，有较为复杂的社会行为、捕猎技巧和声音交流等。 [24] 海洋中，虎鲸是“海上杀手”，小到鱼类、乌贼、海龟，大到海狮、海豹甚至须鲸和抹香鲸，都难逃虎鲸的捕杀，因此，虎鲸也有着“杀手鲸”的称号。 [25] 海洋环境的污染以及大量捕捉虎鲸活体用于水族贸易，虎鲸的生存受到严重威胁 [26] ，现已被列为中国二级保护野生动物。 [19]</p>'),(1031933958,'<p>虎鲸，是鲸偶蹄目海豚科虎鲸属 [19] 哺乳动物 [20] 。成体体重6600千克，平均体长6-9米；头部略圆，具有不明显的喙或无喙；身体黑、白两色；眼的后上方具椭圆